import Santeros from "../pages/Santeros.js";
import Texts from "../pages/Texts.js";
import {  HashRouter, Switch, Route, Link } from 'react-router-dom';

function Music() {
  return (
    <HashRouter>
      <div className="container">
      <h1>Music</h1>
      <nav className="menu">
          <ul>
            <li className="menu-item"><Link className="menu__link" to="/bio">Bio</Link></li>
            <li className="menu-item"><Link className="menu__link" to="/nosdois">Nos dois</Link></li>
            <li className="menu-item"><Link className="menu__link" to="/music">Texts</Link></li>
          </ul>
      </nav>
      </div>
      <Switch>

        <Route path="/nosdois" exact>
          <div><h1>nos dois</h1></div>
          </Route>
          <Route path="/texts" exact>
        <Texts />
        </Route>
        <Route path="/services" exact>
        </Route>
      </Switch>
            </HashRouter>
          );
        }

        export default Music;
